import React from 'react'
import "./header.css";

const Header = () => {
    return (
        <header className="header">
            <nav className="nav container">
                <a href="">ABOUT</a>
                <a href="">PROJECTS</a>
                <a href="">CONTACT</a>
                <a href="">RESUME</a>
            </nav>
        </header>
    )
}

export default Header
